        static Dictionary<string, string> dict = new();
        static long defaultHumnValue = 0;

        public static void Run()
        {
            dict = args.Split("\r\n")
                .ToDictionary(x => x.Split(":")[0], x => x.Split(":")[1].Trim());
            defaultHumnValue = long.Parse(dict["humn"]);

            BinarySearch();
            Console.WriteLine(dict["humn"]);
        }

        private static void BinarySearch()
        {
            long min = -10000000000000;
            long max = min * -1;
            for (int i = 0; ; i++)
            {
                var half = (min + (max - min) / 2);
                AddToHumn(half);

                var result = Find(dict["root"]);
                Console.WriteLine($"trying: {half,15}\t\tresult: {result}");
                if (result == 0)
                {
                    break;
                }
                if (result > 0)
                {
                    min = half;
                }
                else
                {
                    max = half;
                }
            }
        }

        public static void AddToHumn(long value)
        {
            dict["humn"] = (defaultHumnValue + value).ToString();
        }

        public static long Find(string value)
        {
            if (long.TryParse(value, out var casted))
            {
                return casted;
            }

            var splitted = value.Split(" = ");
            if (splitted.Length == 2)
            {
                var first = Find(dict[splitted[0]]);
                var second = Find(dict[splitted[1]]);
                return first - second;
            }

            splitted = value.Split(" + ");
            if (splitted.Length == 2)
            {
                var result = Find(dict[splitted[0]]) + Find(dict[splitted[1]]);
                return result;
            }

            splitted = value.Split(" - ");
            if (splitted.Length == 2)
            {
                var result = Find(dict[splitted[0]]) - Find(dict[splitted[1]]);
                return result;
            }

            splitted = value.Split(" * ");
            if (splitted.Length == 2)
            {
                var result = Find(dict[splitted[0]]) * Find(dict[splitted[1]]);
                return result;
            }

            splitted = value.Split(" / ");
            if (splitted.Length == 2)
            {
                var result = Find(dict[splitted[0]]) / Find(dict[splitted[1]]);
                return result;
            }

            throw new NotImplementedException();
        }
